import "./Details.css";

function Details(props) {
  const [locations, setLocations] = useState([]);
  const [mealtype, setMealtype] = useState([]);

  useEffect(() => {
    axios
      .get("./location")
      .then((res) => {
        const data = res.data;
        console.log(data);
        setLocations(data.location);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  useEffect(() => {
    axios
      .get("./mealtype")
      .then((res) => {
        const data = res.data;
        console.log(data);
        setMealtype(data.mealtype);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div className="container">
      <div class="card  ">
        <img
